custom_css:
.owl-carousel {
    display: block;
}
.mb-50{
margin-bottom:50px;

}
#{{section}} #testimonial4 .owl-next span {
    font-size: 38px;
    position: absolute;
    right: 0%;
    top: 65%;
    background: var(--bs-body-bg);
    width: 32px;
    height: 32px;
    color: var(--netmanthan-primary-color);
    line-height: 0.5;
    border-radius: 50%;
    box-shadow: rgb(99 99 99 / 20%) 0px 2px 8px 0px;
}

#{{section}} #testimonial4 .owl-prev span {
    font-size: 38px;
    position: absolute;
    right: 4%;
    top: 65%;
    background: var(--bs-body-bg);
    width: 32px;
    height: 32px;
    color: var(--netmanthan-primary-color);
    line-height: 0.5;
    border-radius: 50%;
    box-shadow: rgb(99 99 99 / 20%) 0px 2px 8px 0px;
}

#{{section}} .testimonial4image{
    height: 300px;
    object-fit: contain;
     border-radius:10px;
}
#{{section}} .mobile-height{
    max-height: 340px;
}
@media only screen and (max-width: 768px) {
#{{section}} .mobile-height{
    max-height:580px;
}
#{{section}} #testimonial4 .owl-next span {
    left: 15%;
    top: 64%;
}
#{{section}} #testimonial4 .owl-prev span {
    left: 5%;
    top: 64%;
}
}

